"use strict";

function numOfSubarrays(arr) {
    const MOD = 1e9 + 7;
    let counter = [0, 0];
    let s = 0, ans = 0;
    for (let i = 0; i < arr.length; i++) {
        s += arr[i];
        counter[s % 2]++;
        if (s % 2 === 1) {
            ans += 1 + counter[0];
        } else {
            ans += counter[1];
        }
    }
    return ans % MOD;
}
